		public void Test_02_Encapsulate(string ModelName, string ek, string dk, string c,
			string k, string m)
		{
			byte[] ekBin = Hashes.StringToBinary(ek);
			byte[] dkBin = Hashes.StringToBinary(dk);
			byte[] cBin = Hashes.StringToBinary(c);
			byte[] kBin = Hashes.StringToBinary(k);
			byte[] mBin = Hashes.StringToBinary(m);
			Console.Out.WriteLine("ek: " + Hashes.BinaryToString(ekBin));
			Console.Out.WriteLine("dk: " + Hashes.BinaryToString(dkBin));
			Console.Out.WriteLine("c: " + Hashes.BinaryToString(cBin));
			Console.Out.WriteLine("k: " + Hashes.BinaryToString(kBin));
			Console.Out.WriteLine("m: " + Hashes.BinaryToString(mBin));

			ML_KEM Model = ML_KEM.GetModel(ModelName);
			ML_KEM_Encapsulation Result = Model.Encapsulate_Internal(ekBin, mBin);

			Assert.AreEqual(c, Hashes.BinaryToString(Result.CipherText).ToUpper(), "Cipher Text c mismatch");
			Assert.AreEqual(k, Hashes.BinaryToString(Result.SharedSecret).ToUpper(), "Shared Secret K mismatch");

			Console.Out.WriteLine("K: " + Hashes.BinaryToString(Result.SharedSecret));
		}

