			byte[] dkBin = Hashes.StringToBinary(dk);
			byte[] cBin = Hashes.StringToBinary(c);
			byte[] kBin = Hashes.StringToBinary(k);
			Console.Out.WriteLine("ek: " + Hashes.BinaryToString(ekBin));
			Console.Out.WriteLine("dk: " + Hashes.BinaryToString(dkBin));
			Console.Out.WriteLine("c: " + Hashes.BinaryToString(cBin));
			Console.Out.WriteLine("k: " + Hashes.BinaryToString(kBin));

			ML_KEM Model = ML_KEM.GetModel(ModelName);
			byte[] Result = Model.Decapsulate(dkBin, cBin);

			Console.Out.WriteLine("K: " + Hashes.BinaryToString(Result));

			bool ValidExpected = Reason.StartsWith("valid");
			bool Valid = string.Compare(k, Hashes.BinaryToString(Result), true) == 0;

			Assert.AreEqual(ValidExpected, Valid, Reason);
		}
